DROP TABLE IF EXISTS `investigation`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `investigation` (
  `inv_id` int NOT NULL COMMENT 'номер расследования',
  `inv_status` int DEFAULT NULL COMMENT 'статус расследования',
  `resp_inv` int DEFAULT NULL COMMENT 'идентификатор ответственного за расследование',
  `have_measures` tinyint(1) DEFAULT NULL COMMENT 'признак наличия мер',
  `resp_un_id` int DEFAULT NULL COMMENT 'идентификатор ответственного предприятия',
  `measure_id` int DEFAULT NULL COMMENT 'связка с мерами',
  `conclusion` text COMMENT 'заключение по расследованию',
  PRIMARY KEY (`inv_id`),
  KEY `responsiblities_id` (`resp_un_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='расследование событий';
